import React from 'react'
import IndividualPerson from './IndividualPerson'

function ListItem({listItem, setSelectedItem}) {
  return (
    <div>
        {
            listItem.map(item=>{
                return <div key={item.id}><IndividualPerson person={item}/></div>
            })
        }
    </div>
  )
}

export default ListItem
